In C, static variables and register variables are two types of storage class specifiers that can be used to declare variables. Here's a brief overview of each:

**Static Variables**

A static variable is a variable that retains its value between function calls. When a static variable is declared inside a function, it is initialized only once, when the function is first called, and retains its value for subsequent calls to the function. Static variables are stored in data segment of memory.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    static int count = 0;
    count++;
    printf("%d\n", count);
}

int main() {
    my_function(); // prints 1
    my_function(); // prints 2
    my_function(); // prints 3
    return 0;
}
```
In this example, the static variable `count` is initialized to 0 when `my_function` is first called, and then incremented to 1, 2, and 3 for each subsequent call.

**Register Variables**

A register variable is a variable that is stored in a CPU register, rather than in memory. This can improve performance by reducing the number of memory accesses. However, the compiler is not required to store the variable in a register, and the variable may still be stored in memory.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    register int x = 5;
    printf("%d\n", x);
}

int main() {
    my_function(); // prints 5
    return 0;
}
```
